/* styles */


/* components */
import Head from '../components/common/Head/index';

const Navbar = () => {
    return (
        <div>
            <ul>
                <li><a href="/">Home</a></li>
                <li><a href="/blog">Blog</a></li>
                <li><a href="/about">About</a></li>
                <li><a href="/contact">Contact</a></li>
            </ul>
        </div>
    );
}


export default Navbar;
